/*!
 * * Quasar Framework v1.14.7
 * * (c) 2015-present Razvan Stoenescu
 * * Released under the MIT License.
 * */
*, *:before, *:after {
  box-sizing: inherit;
  -webkit-tap-highlight-color: transparent;
  -moz-tap-highlight-color: transparent;
}

html, body, #q-app {
  width: 100%;
  direction: ltr;
}

body.platform-ios.within-iframe, body.platform-ios.within-iframe #q-app {
  width: 100px;
  min-width: 100%;
}

html, body {
  margin: 0;
  box-sizing: border-box;
}

article,
aside,
details,
figcaption,
figure,
footer,
header,
main,
menu,
nav,
section,
summary {
  display: block;
}

/* * line 1: Remove the bottom border in Firefox 39-.
 * * lines 2,3: Add the correct text decoration in Chrome, Edge, IE, Opera, and Safari.
 * */
abbr[title] {
  border-bottom: none;
  text-decoration: underline;
  text-decoration: underline dotted;
}

img {
  border-style: none;
}

svg:not(:root) {
  overflow: hidden;
}

/* * line 1: Correct the inheritance and scaling of font size in all browsers.
 * * line 2: Correct the odd `em` font sizing in all browsers.
 * */
code, kbd, pre, samp {
  font-family: monospace, monospace;
  font-size: 1em;
}

/* * lines 1,2: Add the correct box sizing in Firefox.
 * * line 3: Show the overflow in Edge and IE.
 * */
hr {
  box-sizing: content-box;
  height: 0;
  overflow: visible;
}

button,
input,
optgroup,
select,
textarea {
  font: inherit;
  font-family: inherit;
  margin: 0;
}

optgroup {
  font-weight: bold;
}

/* * Show the overflow in IE.
 * *  input: Show the overflow in Edge.
 * *  select: Show the overflow in Edge, Firefox, and IE.
 * * Remove the inheritance of text transform in Edge, Firefox, and IE.
 * *  select: Remove the inheritance of text transform in Firefox.
 * */
button,
input,
select {
  overflow: visible;
  text-transform: none;
}

button::-moz-focus-inner, input::-moz-focus-inner {
  border: 0;
  padding: 0;
}

button:-moz-focusring, input:-moz-focusring {
  outline: 1px dotted ButtonText;
}

fieldset {
  padding: 0.35em 0.75em 0.625em;
}

/**
 * * lines 1,3,4,6: Correct the text wrapping in Edge and IE.
 * * line 2: Correct the color inheritance from `fieldset` elements in IE.
 * * line 5: Remove the padding so developers are not caught out when they zero out
 * *    `fieldset` elements in all browsers.
 * */
legend {
  box-sizing: border-box;
  color: inherit;
  display: table;
  max-width: 100%;
  padding: 0;
  white-space: normal;
}

progress {
  vertical-align: baseline;
}

textarea {
  overflow: auto;
}

input[type=search] {
  -webkit-appearance: textfield;
}

input[type=search]::-webkit-search-cancel-button,
input[type=search]::-webkit-search-decoration {
  -webkit-appearance: none;
}

.q-icon {
  line-height: 1;
  width: 1em;
  height: 1em;
  letter-spacing: normal;
  text-transform: none;
  white-space: nowrap;
  word-wrap: normal;
  direction: ltr;
  text-align: center;
  position: relative;
  box-sizing: content-box;
  fill: currentColor;
}
.q-icon:before, .q-icon:after {
  width: 100%;
  height: 100%;
  display: flex !important;
  align-items: center;
  justify-content: center;
}
.q-icon > svg {
  width: 100%;
  height: 100%;
}

.q-icon,
.material-icons,
.material-icons-outlined,
.material-icons-round,
.material-icons-sharp {
  user-select: none;
  cursor: inherit;
  font-size: inherit;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  vertical-align: middle;
}

.q-panel {
  height: 100%;
  width: 100%;
}
.q-panel > div {
  height: 100%;
  width: 100%;
}

.q-panel-parent {
  overflow: hidden;
  position: relative;
}

.q-loading-bar {
  position: fixed;
  z-index: 9998;
  transition: transform 0.5s cubic-bezier(0, 0, 0.2, 1), opacity 0.5s;
  background: #f44336;
}
.q-loading-bar--top {
  left: 0 /* rtl:ignore */;
  right: 0 /* rtl:ignore */;
  top: 0;
  width: 100%;
}
.q-loading-bar--bottom {
  left: 0 /* rtl:ignore */;
  right: 0 /* rtl:ignore */;
  bottom: 0;
  width: 100%;
}
.q-loading-bar--right {
  top: 0;
  bottom: 0;
  right: 0;
  height: 100%;
}
.q-loading-bar--left {
  top: 0;
  bottom: 0;
  left: 0;
  height: 100%;
}

.q-avatar {
  position: relative;
  vertical-align: middle;
  display: inline-block;
  border-radius: 50%;
  font-size: 48px;
  height: 1em;
  width: 1em;
}
.q-avatar__content {
  font-size: 0.5em;
  line-height: 0.5em;
}
.q-avatar__content, .q-avatar img:not(.q-icon) {
  border-radius: inherit;
  height: inherit;
  width: inherit;
}
.q-avatar--square {
  border-radius: 0;
}

.q-badge {
  background-color: #1976D2;
  background-color: var(--q-color-primary);
  color: #fff;
  padding: 2px 6px;
  border-radius: 4px;
  font-size: 12px;
  line-height: 12px;
  font-weight: normal;
  vertical-align: baseline;
}
.q-badge--single-line {
  white-space: nowrap;
}
.q-badge--multi-line {
  word-break: break-all;
  word-wrap: break-word;
}
.q-badge--floating {
  position: absolute;
  top: -4px;
  right: -3px;
  cursor: inherit;
}
.q-badge--transparent {
  opacity: 0.8;
}
.q-badge--outline {
  background-color: transparent;
  border: 1px solid currentColor;
}

.q-banner {
  min-height: 54px;
  padding: 8px 16px;
  background: #fff;
}
.q-banner--top-padding {
  padding-top: 14px;
}
.q-banner__avatar {
  min-width: 1px !important;
}
.q-banner__avatar > .q-avatar {
  font-size: 46px;
}
.q-banner__avatar > .q-icon {
  font-size: 40px;
}
.q-banner__avatar:not(:empty) + .q-banner__content {
  padding-left: 16px;
}
.q-banner__actions.col-auto {
  padding-left: 16px;
}
.q-banner__actions.col-all .q-btn-item {
  margin: 4px 0 0 4px;
}
.q-banner--dense {
  min-height: 32px;
  padding: 8px;
}
.q-banner--dense.q-banner--top-padding {
  padding-top: 12px;
}
.q-banner--dense .q-banner__avatar > .q-avatar, .q-banner--dense .q-banner__avatar > .q-icon {
  font-size: 28px;
}
.q-banner--dense .q-banner__avatar:not(:empty) + .q-banner__content {
  padding-left: 8px;
}
.q-banner--dense .q-banner__actions.col-auto {
  padding-left: 8px;
}

.q-bar {
  background: rgba(0, 0, 0, 0.2);
}
.q-bar > .q-icon {
  margin-left: 2px;
}
.q-bar > div, .q-bar > div + .q-icon {
  margin-left: 8px;
}
.q-bar > .q-btn {
  margin-left: 2px;
}
.q-bar > .q-icon:first-child, .q-bar > .q-btn:first-child, .q-bar > div:first-child {
  margin-left: 0;
}
.q-bar--standard {
  padding: 0 12px;
  height: 32px;
  font-size: 18px;
}
.q-bar--standard > div {
  font-size: 16px;
}
.q-bar--standard .q-btn {
  font-size: 11px;
}
.q-bar--dense {
