eALY;EC41LxB;EDt1LU;IACE,qBAPY;EC+1LxB;;EDr1LU;IACE,gBAXY;IAYZ,WAAA;ECw1LZ;;EDj2LU;IACE,YAAA;IACA,eALY;ECy2LxB;EDn2LU;IACE,qBAPY;EC42LxB;;EDl2LU;IACE,gBAXY;IAYZ,WAAA;ECq2LZ;;ED92LU;IACE,YAAA;IACA,UALY;ECs3LxB;EDh3LU;IACE,gBAPY;ECy3LxB;;ED/2LU;IACE,WAXY;IAYZ,WAAA;ECk3LZ;;ED33LU;IACE,YAAA;IACA,eALY;ECm4LxB;ED73LU;IACE,qBAPY;ECs4LxB;;ED53LU;IACE,gBAXY;IAYZ,WAAA;EC+3LZ;;EDx4LU;IACE,YAAA;IACA,eALY;ECg5LxB;ED14LU;IACE,qBAPY;ECm5LxB;;EDz4LU;IACE,gBAXY;IAYZ,WAAA;EC44LZ;;EDr5LU;IACE,YAAA;IACA,UALY;EC65LxB;EDv5LU;IACE,gBAPY;ECg6LxB;;EDt5LU;IACE,WAXY;IAYZ,WAAA;ECy5LZ;;EDl6LU;IACE,YAAA;IACA,eALY;EC06LxB;EDp6LU;IACE,qBAPY;EC66LxB;;EDn6LU;IACE,gBAXY;IAYZ,WAAA;ECs6LZ;;ED/6LU;IACE,YAAA;IACA,eALY;ECu7LxB;EDj7LU;IACE,qBAPY;EC07LxB;;EDh7LU;IACE,gBAXY;IAYZ,WAAA;ECm7LZ;;ED57LU;IACE,YAAA;IACA,WALY;ECo8LxB;ED97LU;IACE,iBAPY;ECu8LxB;;ED77LU;IACE,YAXY;IAYZ,WAAA;ECg8LZ;AACF","file":"flex-addon.sass","sourcesContent":["@import '~src/css/quasar.variables.scss', 'quasar/src/css/variables.sass'
@import './helpers/string.sass'
@import './helpers/math.sass'

@import './variables.sass'

@mixin fg($name, $size)
  $noProcZero: $size == 0
  $noProcNotZero: $size > 0

  @media (min-width: $size)
    #{str-fe('.flex<name>-', $name, $noProcNotZero)}
      &block
        display: block
      &inline
        display: inline-block

    @each $space, $value in $spaces
      .q-pa#{$name}-#{$space}
        padding: map-get($value, "y") map-get($value, "x")
      .q-pl#{$name}-#{$space}
        padding-left: map-get($value, "x")
      .q-pr#{$name}-#{$space}
        padding-right: map-get($value, "x")
      .q-pt#{$name}-#{$space}
        padding-top: map-get($value, "y")
      .q-pb#{$name}-#{$space}
        padding-bottom: map-get($value, "y")
      .q-px#{$name}-#{$space}
        padding-left: map-get($value, "x")
        padding-right: map-get($value, "x")
      .q-py#{$name}-#{$space}
        padding-top: map-get($value, "y")
        padding-bottom: map-get($value, "y")

      .q-ma#{$name}-#{$space}
        margin: map-get($value, "y") map-get($value, "x")
      .q-ml#{$name}-#{$space}
        margin-left: map-get($value, "x")
      .q-mr#{$name}-#{$space}
        margin-right: map-get($value, "x")
      .q-mt#{$name}-#{$space}
        margin-top: map-get($value, "y")
      .q-mb#{$name}-#{$space}
        margin-bottom: map-get($value, "y")
      .q-mx#{$name}-#{$space}
        margin-left: map-get($value, "x")
        margin-right: map-get($value, "x")
      .q-my#{$name}-#{$space}
        margin-top: map-get($value, "y")
        margin-bottom: map-get($value, "y")

    .q-ml#{$name}-auto
      margin-left: auto
    .q-mr#{$name}-auto
      margin-right: auto
    .q-mx#{$name}-auto
      margin-left: auto
      margin-right: auto

    .row, .column, .flex
      @if $noProcNotZero
        #{str-fr('&.inline<name>', $name)}
          display: inline-flex
      #{str-fr('&<name>', $name)}
        display: flex
        flex-wrap: wrap
        #{str-fe('&.inline<name>', $name, $noProcZero)}
          display: inline-flex

    .row
      @if $noProcNotZero
        #{str-fr('&.reverse<name>', $name)}
          flex-direction: row-reverse
      #{str-fr('&<name>', $name)}
        flex-direction: row
        #{str-fe('&.reverse<name>', $name, $noProcZero)}
          flex-direction: row-reverse

    .column
      @if $noProcNotZero
        #{str-fr('&.reverse<name>', $name)}
          flex-direction: column-reverse
      #{str-fr('&<name>', $name)}
        flex-direction: column
        #{str-fe('&.reverse<name>', $name, $noProcZero)}
          flex-direction: column-reverse

    #{str-fr('.wrap<name>', $name)}
      flex-wrap: wrap
    #{str-fr('.no-wrap<name>', $name)}
      flex-wrap: nowrap
    #{str-fr('.reverse-wrap<name>', $name)}
      flex-wrap: wrap-reverse

    #{str-fr('.order<name>-', $name)}
      &first
        order: -10000
      &last
        order: 10000
      &none
        order: 0

    #{str-fr('.justify<name>-', $name)}
      &start
        justify-content: flex-start
      &end
        justify-content: flex-end
      &center
        justify-content: center
      &between
        justify-content: space-between
      &around
        justify-content: space-around
      &evenly
        justify-content: space-evenly

    #{str-fr('.items<name>-', $name)}
      &start
        align-items: flex-start
      &end
        align-items: flex-end
      &center
        align-items: center
      &baseline
        align-items: baseline
      &stretch
        align-items: stretch

    #{str-fr('.content<name>-', $name)}
      &start
        align-content: flex-start
      &end
        align-content: flex-end
      &center
        align-content: center
      &between
        align-content: space-between
      &around
        align-content: space-around

    #{str-fr('.self<name>-', $name)}
      &start
        align-self: flex-start
      &end
        align-self: flex-end
      &center
        align-self: center
      &baseline
        align-self: baseline
      &stretch
        align-self: stretch

    #{str-fr('.flex<name>-center', $name)}
      @extend .items#{$name}-center
      @extend .justify#{$name}-center

    @each $gname, $gsize in $flex-gutter
      #{str-fr('.q-gutter<name>', $name)}
        &-x-#{$gname}
          margin-left: -$gsize
          > *
            margin-left: $gsize
        &-y-#{$gname}
          margin-top: -$gsize
          > *
            margin-top: $gsize
        &-#{$gname}
          margin-left: -$gsize
          margin-top: -$gsize
          > *
            margin-left: $gsize
            margin-top: $gsize

      #{str-fr('.q-col-gutter<name>', $name)}
        &-x-#{$gname}
          margin-left: -$gsize
          > *
            padding-left: $gsize
        &-y-#{$gname}
          margin-top: -$gsize
          > *
            padding-top: $gsize
        &-#{$gname}
          margin-left: -$gsize
          margin-top: -$gsize
          > *
            padding-left: $gsize
            padding-top: $gsize

    @each $name2, $size2 in $sizes
      @if $size >= $size2
        $name2c: "-#{$name2}"
        $noProcNotZero2: ($size2 > 0)

        @for $i from 0 through $flex-cols
          $ic: quote('' + $i)
          $internal-size: toFixed(percentage($i / $flex-cols), 10000)

          #{str-fr('.row<name>', $name)}
            #{str-fe('> .col<name>-<i>', $name2c, $noProcNotZero2, $ic)}
              height: auto
              width: $internal-size
            #{str-fe('> .offset<name>-<i>', $name2c, $noProcNotZero2, $ic)}
              margin-left: $internal-size

          #{str-fr('.column<name>', $name)}
            #{str-fe('> .col<name>-<i>', $name2c, $noProcNotZero2, $ic)}
              height: $internal-size
              width: auto

@each $name, $size in $sizes
  @include fg("-" + $name, $size)
